unistr('<!-- Aqu\00ED puedes agregar tus propios scripts JS si los necesitas -->'),
' ',
'        <!-- Script para mostrar la fecha actual y la hora del sistema -->',
'<script>',
'            // Obtener la fecha actual en formato "dd/mm/yyyy"',
'            var today = new Date();',
'            var dd = String(today.getDate()).padStart(2, ''0'');',
'            var mm = String(today.getMonth() + 1).padStart(2, ''0''); // Enero es 0',
'            var yyyy = today.getFullYear();',
'            var fechaActual = dd + ''/'' + mm + ''/'' + yyyy;',
' ',
'            // Obtener la hora actual en formato "HH:MM:SS"',
'            var hh = String(today.getHours()).padStart(2, ''0'');',
'            var min = String(today.getMinutes()).padStart(2, ''0'');',
'            var ss = String(today.getSeconds()).padStart(2, ''0'');',
'            var horaActual = hh + '':'' + min + '':'' + ss;',
' ',
'            // Insertar la fecha actual y la hora actual en los campos de formulario correspondientes',
'            document.getElementById(''fecha-actual'').value = fechaActual;',
'            document.getElementById(''hrs-inicio'').value = horaActual;',
'</script>',
' ',
'<script>',
'    var datosFormulario = [];',
' ',
unistr('    // Esperar a que el DOM est\00E9 completamente cargado'),
' ',
'  document.addEventListener(''DOMContentLoaded'', function() {',
'    var botonGuardar = document.querySelector(''#modalFormulario .btn-primary'');',
'    botonGuardar.addEventListener(''click'', function(event) {',
unistr('        event.preventDefault(); // Prevenir el comportamiento por defecto del bot\00F3n'),
'        guardarDatos();',
'    });',
'    document.getElementById(''horaIngreso'').addEventListener(''change'', calcularYMostrarHorasTotal);',
'    document.getElementById(''horaSalida'').addEventListener(''change'', calcularYMostrarHorasTotal);',
'});',
'      function calcularYMostrarHorasTotal() {',
'        var horaIngreso = document.getElementById(''horaIngreso'').value;',
'        var horaSalida = document.getElementById(''horaSalida'').value;',
'        var horasTotal = calcularHorasTotal(horaIngreso, horaSalida);',
'        document.getElementById(''horasTotal'').value = horasTotal >= 0 ? horasTotal.toFixed(2) : '''';',
'    }',
'function guardarDatos() {',
'    var camposRequeridos = document.querySelectorAll(''#registroFormulario .form-control'');',
'    var todosLosCamposLlenos = true;',
' ',
'    camposRequeridos.forEach(function(campo) {',
'        if (!campo.value) {',
'            todosLosCamposLlenos = false;',
'        }',
'    });',
' ',
'    if (!todosLosCamposLlenos) {',
'        alert(''Por favor, llene todos los campos requeridos.'');',
unistr('        return; // No continuar si hay campos vac\00EDos'),
