' ',
unistr('    // Correcci\00F3n de IDs para coincidir con los elementos del formulario'),
'    var N_ITEM = document.getElementById(''N_ITEM'').value;',
'    var licenciaConducir = document.getElementById(''licenciaConducir'').value;',
'    var placaTracto = document.getElementById(''placaTracto'').value; // Corregido de ''placaTractor''',
'    var placaCarreta = document.getElementById(''placaCarreta'').value;',
'    var regimen = document.getElementById(''regimen'').value;',
'    var nroDia = document.getElementById(''nroDia'').value;',
'    var horaIngreso = document.getElementById(''horaIngreso'').value; // Corregido de ''hrsIngreso''',
'    var horaSalida = document.getElementById(''horaSalida'').value; // Corregido de ''hrsSalida''',
'    var horasTotal = document.getElementById(''horasTotal'').value; // Corregido de ''hrsTotal''',
'    var horasSueno = document.getElementById(''horasSueno'').value; // Corregido de ''hrsSueno''',
