'        // Diferencia en milisegundos',
'        var diferencia = salida - ingreso;',
' ',
'        // Convertir a horas',
'        return diferencia / (1000 * 60 * 60);',
'    }',
' ',
'function actualizarTabla() {',
'    var tabla = document.getElementById(''tablaDatos'');',
