unistr('            ''<td>'' + (persona.horasTotal !== undefined ? persona.horasTotal : '''') + ''</td>'' + // Verificar si horasTotal est\00E1 definido'),
unistr('            ''<td>'' + (persona.horasSueno !== undefined ? persona.horasSueno : '''') + ''</td>'' + // Verificar si horasSueno est\00E1 definido'),
'            ''<td>'' + persona.resultadoAlcoholemia + ''</td>'' +',
'            ''<td>'' + persona.cantidadCel + ''</td>'' +',
'            ''<td>'' + persona.firma + ''</td>'' +',
'            ''<td>'' + persona.observaciones + ''</td>'' +',
'            ''</tr>'';',
'        tabla.innerHTML += fila;',
'    });',
'}',
' ',
'</script>',
' ',
' ',
'    </form>',
'</div>',
' ',
'</body>',
'</html>'))
