'    l_file_id VARCHAR2(100);',
unistr('    l_response_code NUMBER; -- Variable para almacenar el c\00F3digo de respuesta'),
'',
'BEGIN',
'    -- Obtener el contenido del archivo PDF como BLOB y el nombre del archivo',
'    SELECT blob_content, filename, id INTO l_file, FileName, l_file_id FROM APEX_APPLICATION_TEMP_FILES;',
'',
