unistr('    GID := :P3_; --ES EL CAMPO DE LA P\00C1GINA QUE CONTIENE EL ELEMENTO A ENVIAR'),
'',
'    -- Crear el JSON payload con el PDF codificado en base64',
'    payload := ''{',
'      "ObjectId": "'' || GID || ''",',
'      "Object": "Shipment Group",',
'      "Document": "'' || l_encoded_content || ''",',
'      "DocumentName": "'' || FileName || ''"',
'    }'';',
'',
'    apex_web_service.g_request_headers(1).name := ''Content-Type'';   ',
'    apex_web_service.g_request_headers(1).value := ''application/json'';',
'',
'    -- Intenta enviar el archivo y maneja la respuesta',
'    l_resp := apex_web_service.make_rest_request(',
'        p_url         => ''SERVICE_URL'', ',
'        p_http_method => ''POST'',',
'        p_wallet_path => ''SERVICE_WALLET'',',
'        p_username    => ''USER'',',
'        p_password    => ''PASSWORD'',',
'        p_wallet_pwd  => ''WALLET_PASSWORD'',',
'        p_body        => payload',
'    );',
'',
unistr('    -- Obtener el c\00F3digo de estado de la respuesta'),
'    l_status_code := apex_web_service.g_status_code;',
'',
unistr('    -- Almacenar el c\00F3digo de respuesta'),
'    l_response_code := l_status_code;',
'',
'    -- Elimina el registro de la tabla temporal',
'    DELETE FROM APEX_APPLICATION_TEMP_FILES WHERE id = l_file_id;',
'    COMMIT;',
'    ',
'',
'END;',
