'    <script>',
'        function checkFormAndGeneratePDF() {',
'            var formElements = document.querySelector(''form'').elements;',
'            var radioGroups = {};',
'    ',
'            // Primero, agrupar todos los radio buttons',
'            for (var i = 0; i < formElements.length; i++) {',
'                var element = formElements[i];',
'                if (element.type === ''radio'') {',
'                    radioGroups[element.name] = radioGroups[element.name] || [];',
'                    radioGroups[element.name].push(element);',
'                }',
'            }',
'    ',
'            // Verificar cada grupo de radio buttons',
'            for (var groupName in radioGroups) {',
'                if (radioGroups.hasOwnProperty(groupName)) {',
'                    var radioGroupChecked = radioGroups[groupName].some(radio => radio.checked);',
'                    if (!radioGroupChecked) {',
unistr('                        swal(''Selecci\00F3n requerida'', ''Por favor, selecciona una opci\00F3n para: '' + groupName, ''error'');'),
'                        return;',
'                    }',
'                }',
'            }',
'    ',
'            // Verificar los campos de texto y otros tipos',
'            for (var i = 0; i < formElements.length; i++) {',
'                var element = formElements[i];',
'                if (element.required && element.type !== ''radio'' && !element.value.trim()) {',
'                    swal(''Campo requerido faltante'', ''Favor de completar: '' + (element.placeholder || element.name || ''Campo sin nombre''), ''error'');',
'                    return;',
'                }',
'            }',
'',
'            ',
'            //DETECTA OS DEL USUARIO',
'            var userAgent = navigator.userAgent || navigator.vendor || window.opera;',
'',
'',
'',
'',
'            if (/windows phone/i.test(userAgent)) {',
'        console.log("Not Available");',
'    }',
'    else if (/android/i.test(userAgent)) {',
'        generatePDFAndroid();',
'        console.log("AndroidPDF");',
'    }',
'    else if (/iPad|iPhone|iPod/.test(userAgent) && !window.MSStream) {',
'        generatePDF();',
'        console.log("IOSPDF");',
'    }',
'    else {',
'        // Por defecto, se asume escritorio',
'        generatePDFDesktop();',
'        console.log("DesktopPDF");',
'    }',
'',
'}',
