 p_id=>wwv_flow_imp.id(87918921485731266859)
,p_plug_name=>'-'
,p_region_name=>'printableArea'
,p_region_template_options=>'#DEFAULT#:t-Region--scrollBody'
,p_plug_template=>wwv_flow_imp.id(87909140574022952738)
,p_plug_display_sequence=>30
,p_function_body_language=>'PLSQL'
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE  ',
'	v_ORDER_RELEASE_TYPE_GID     VARCHAR2(101);',
'	v_ORDER_RELEASE_GID	         VARCHAR2(50);',
'	v_ORDER_USERNAME	         VARCHAR2(240);',
'	v_ORDER_DATE	             DATE;',
'	v_LOCATION_NAME              VARCHAR2(360);',
'	v_FROM_LOCATION_XID          VARCHAR2(50);',
'	v_FROM_ADDRESS_LINE          VARCHAR2(1000);',
'	v_FROM_CITY                  VARCHAR2(240);',
'	v_TO_ADDRESS_LINE            VARCHAR2(240);',
'	v_RECIPIENTS_NAME            VARCHAR2(240);',
'	v_TO_LOCATION_XID            VARCHAR2(50);',
'	v_TO_CITY                    VARCHAR2(240);',
'	v_DESTINATION_CONTACT_PERSON VARCHAR2(240);',
'	v_CELLPHONE                  VARCHAR2(240);',
'	v_DESTINATION_CONTACT_EMAIL  VARCHAR2(240);',
'	v_TRANSFER_REASON	         VARCHAR2(240);',
'	v_COST_CENTER	             VARCHAR2(240);',
'	v_GL_ACCOUNT	             VARCHAR2(240);',
'	v_CHARGE_TYPE	             VARCHAR2(240);',
'		',
'	',
'	',
'	v_ORDER_QTY         NUMBER;',
'	v_ORDER_PRICE       NUMBER;',
'	v_ORDER_TOTAL       NUMBER;',
'	',
'	v_mast_header     VARCHAR2 (4000);',
'	v_child VARCHAR2 (4000);',
'	v_mast_footer VARCHAR2(400);',
'	',
'BEGIN',
'SELECT',
'	ORDER_RELEASE_TYPE_GID',
'	,ORDER_RELEASE_GID	      ',
'	,ORDER_USERNAME	          ',
'	,ORDER_DATE	              ',
'	,LOCATION_NAME             ',
'	,FROM_LOCATION_XID         ',
'	,FROM_ADDRESS_LINE         ',
'	,FROM_CITY                 ',
'	,TO_ADDRESS_LINE           ',
'	,RECIPIENTS_NAME           ',
'	,TO_LOCATION_XID           ',
'	,TO_CITY                   ',
'	,DESTINATION_CONTACT_PERSON',
'	,CELLPHONE                 ',
'	,DESTINATION_CONTACT_EMAIL ',
'	,TRANSFER_REASON	          ',
'	,COST_CENTER	              ',
'	,GL_ACCOUNT	              ',
'	,CHARGE_TYPE	                ',
'INTO ',
'	v_ORDER_RELEASE_TYPE_GID',
'	,v_ORDER_RELEASE_GID	       ',
'	,v_ORDER_USERNAME	       ',
'	,v_ORDER_DATE	           ',
'	,v_LOCATION_NAME            ',
'	,v_FROM_LOCATION_XID        ',
'	,v_FROM_ADDRESS_LINE        ',
'	,v_FROM_CITY                ',
'	,v_TO_ADDRESS_LINE          ',
'	,v_RECIPIENTS_NAME          ',
'	,v_TO_LOCATION_XID          ',
'	,v_TO_CITY                  ',
'	,v_DESTINATION_CONTACT_PERSON',
'	,v_CELLPHONE                ',
'	,v_DESTINATION_CONTACT_EMAIL',
'	,v_TRANSFER_REASON	       ',
'	,v_COST_CENTER	           ',
'	,v_GL_ACCOUNT	           ',
'	,v_CHARGE_TYPE	           ',
'FROM ',
'	LBI_ORDER_RELEASE       ',
'WHERE 1=1',
'	--AND ORDER_RELEASE_GID = ''MOVIN00000702'';',
'	AND ORDER_RELEASE_GID = :P14_ORDER_RELEASE_GID;',
'',
'		',
'		',
'v_mast_header:=''',
'',
'	<style type="test/css" media="all">',
'		table, th,td { ',
'			border:1px solid black;',
'				border-collapse: collapse;',
'				',
'		}',
'			p.small { ',
'		line-height: 1; ',
'}',
'',
'		</style>',
'		<body>',
'',
'		',
'',
'		<div id="dvil">',
'			<div id="printable_div">',
'				<center id="top">',
'			<div class="logo"><img style="height: 40px";" src= "#APP_FILES#Las_bambas_logo.png"></div>',
'<div>',
'',
'<div class="myDiv">',
'	<p>INBOUND TRANSPORTATION REQUEST FORM </p> </br>',
'	',
'</div>',
'',
'</center>',
'		ORDER_RELEASE_GID :<b> ''||v_ORDER_RELEASE_GID||''</b> </br>''||',
'		''ORDER_USERNAME : <b>''||             v_ORDER_USERNAME || ''</b></br>''||',
'		''ORDER_DATE : <b>''||                 v_ORDER_DATE || ''</b></br>''||',
'		''LOCATION_NAME : <b>''||              v_LOCATION_NAME || ''</b></br>''||',
'		''FROM_LOCATION_XID : <b>''||          v_FROM_LOCATION_XID || ''</b></br>''||',
'		''FROM_ADDRESS_LINE : <b>''||          v_FROM_ADDRESS_LINE || ''</b></br>''||',
'		''FROM_CITY : <b>''||                  v_FROM_CITY || ''</b></br>''||',
'		''TO_ADDRESS_LINE : <b>''||            v_TO_ADDRESS_LINE || ''</b></br>''||',
'		''RECIPIENTS_NAME : <b>''||            v_RECIPIENTS_NAME || ''</b></br>''||',
'		''TO_LOCATION_XID : <b>''||            v_TO_LOCATION_XID || ''</b></br>''||',
'		''TO_CITY : <b>''||                    v_TO_CITY || ''</b></br>''||',
'		''DESTINATION_CONTACT_PERSON : <b>''|| v_DESTINATION_CONTACT_PERSON || ''</b></br>''||',
'		''DESTINATION_CONTACT_EMAIL : <b>''||  v_DESTINATION_CONTACT_EMAIL || ''</b></br>''||',
'		''TRANSFER_REASON : <b>''||            v_TRANSFER_REASON || ''</b></br>''||',
'		''COST_CENTER : <b>''||                v_COST_CENTER || ''</b></br>''||',
'		''GL_ACCOUNT : <b>''||                 v_GL_ACCOUNT || ''</b></br></br>'' ||',
'		''<table >',
'	<tbody>',
'	<tr>',
'',
'		<th style="background-color:LightGray; font-size: 15px;" >Item No</th>',
'		<th style="background-color:LightGray; font-size: 15px;" >Quantity</th>',
'		<th style="background-color:LightGray; font-size: 15px;" >Unit of Measurement</th>',
'		<th style="background-color:LightGray; font-size: 15px;" >Item Description</th>',
'		<th style="background-color:LightGray; font-size: 15px;" >Brand</th>',
'		<th style="background-color:LightGray; font-size: 15px;" >Model</th>',
'		<th style="background-color:LightGray; font-size: 15px;" >Series</th>',
'		<th style="background-color:LightGray; font-size: 15px;" >PO (Purchase Order)</th>',
'		<th style="background-color:LightGray; font-size: 15px;" >Weight (KG)</th>',
'		<th style="background-color:LightGray; font-size: 15px;" >Length (cm)</th>',
'		<th style="background-color:LightGray; font-size: 15px;" >Width (cm)</th>',
'		<th style="background-color:LightGray; font-size: 15px;" >Height (cm)</th>',
'		',
'	</tr>',
'	',
'	<tr>'' ;',
'	',
'	',
'',
'	FOR i IN (SELECT ITEM_DESCRIPTION,            ',
'	SL_NO,                                ',
'					ORDER_RELEASE_GID,                  ',
'					ITEM_PACKAGE_COUNT,                 ',
'					WEIGHT,               ',
'					PACKAGE_LENGTH               ',
'				FROM LBI_ORDER_RELEASE_LINE          ',
'				WHERE 1=1',
'                --AND ORDER_RELEASE_GID = ''MOVIN00000702''',
'                AND ORDER_RELEASE_GID = :P14_ORDER_RELEASE_GID',
'                )',
'	LOOP',
'	',
'	',
'	',
'v_child:=v_child || ',
'',
'		''',
'		<td style="text-align:center ;font-size: 6px;">''||i.SL_NO||''</td>',
'		',
'<td  style="padding-right: 5px;text-align:left; font-size: 6px;">''||i.ITEM_DESCRIPTION || ''</td>',
'',
'',
'			<td style="padding-right: 5px;text-align:right; font-size: 6px;">''',
'			|| i.ITEM_PACKAGE_COUNT                                        --i.BILLAIT',
'			|| ''</td>',
'			<td style="padding-right: 5px;text-align:right; font-size: 6px;">''',
'			|| i.WEIGHT                                      --i.BILLAIT',
'			|| ''</td>',
'			<td style="padding-right: 5px;text-align:right; font-size: 6px;">''',
'			|| i.PACKAGE_LENGTH                                      --i.BILLAIT',
'			|| ''</td>',
'			<td style="padding-right: 5px;text-align:right; font-size: 6px;">''',
'			|| i.PACKAGE_LENGTH                                      --i.BILLAIT',
'			|| ''</td>',
'			',
'			',
'		</tr>    ''',
