'create or replace PROCEDURE CREATE_USER(',
'    P_USERNAME IN VARCHAR2,',
'    P_FIRSTNAME IN VARCHAR2,',
'    P_LASTNAME IN VARCHAR2,',
'    P_EMAIL IN VARCHAR2,',
'    P_PASSWORD IN VARCHAR2,',
'    P_CONFIRM_PASSWORD IN VARCHAR2, -- New parameter for confirm password',
'    P_USERTYPE IN VARCHAR2',
') AS',
'BEGIN',
'    -- Check for null input parameters',
'    IF P_USERNAME IS NULL OR P_FIRSTNAME IS NULL OR P_LASTNAME IS NULL OR P_EMAIL IS NULL OR P_PASSWORD IS NULL OR P_CONFIRM_PASSWORD IS NULL OR P_USERTYPE IS NULL THEN',
'        RAISE_APPLICATION_ERROR(-20001, ''All input parameters must be provided'');',
'    END IF;',
'',
'    -- Check for password complexity or any other validation required',
'    IF LENGTH(P_PASSWORD) < 8 THEN',
'        RAISE_APPLICATION_ERROR(-20003, ''Password must be at least 8 characters long'');',
'    END IF;',
'',
'    -- Check if password and confirm password match',
'    IF P_PASSWORD != P_CONFIRM_PASSWORD THEN',
'        RAISE_APPLICATION_ERROR(-20004, ''Password and Confirm Password must match'');',
'    END IF;',
'',
'    -- Attempt to create user',
'    BEGIN',
'        APEX_UTIL.CREATE_USER(',
'            p_user_name                     => P_USERNAME,',
'            p_first_name                    => P_FIRSTNAME,',
'            p_last_name                     => P_LASTNAME,',
'            p_email_address                 => P_EMAIL,',
'            p_web_password                  => P_PASSWORD,',
'            p_developer_privs               => P_USERTYPE,',
'            p_default_schema                => ''LAS_BAMBAS_INBOUND'',',
'            p_allow_access_to_schemas       => ''LAS_BAMBAS_INBOUND'',',
'            p_change_password_on_first_use  => ''Y''',
'        );',
'    EXCEPTION',
'        WHEN OTHERS THEN',
'            -- Log the error and re-raise',
'            RAISE_APPLICATION_ERROR(-20002, ''Error creating user: '' || SQLERRM);',
'    END;',
'END;',
