'                        FROM LBI_ORDER_RELEASE_LINE ORL',
'                        WHERE ORL.ORDER_RELEASE_GID = orHeader.ORDER_RELEASE_GID) LOOP',
'',
'            IF LENGTH(lines) > 1 THEN',
'                lines :=',
