'                            "package_width": "'' || orLine.package_width || ''",',
'                            "package_height": "'' || orLine.package_height || ''"}'';',
'            ELSE',
'                lines :=',
'                    ''{"item_no": "'' || orLine.item_no || ''","SL_NO": "'' || orLine.SL_NO || ''",',
'                    "item_package_count": "'' || orLine.item_package_count || ''","unit_of_measurement": "'' || orLine.unit_of_measurement || ''",',
